import React from "react";
import {
    Box,
    Center,
    Flex,
    Checkbox,
    Stack,
    Heading,
    Text,
    Button,
} from "@chakra-ui/react";

const Quiz = () => {
    return (
        <Box w={"100%"}>
            <Center h={"100%"}>
                <Flex
                    p={4}
                    w={"50%"}
                    direction={"column"}
                    alignContent="center"
                    alignItems="flex-start"
                >
                    {/* Quiz Title */}
                    <Text
                        m={4}
                        bgGradient="linear(to-l, #7928CA, #FF0080)"
                        bgClip="text"
                        fontSize="5xl"
                        fontWeight="extrabold"
                    >
                        Welcome to Chakra UI
                    </Text>
                    {/* Questions */}
                    {[1, 1, 2, 3, 3].map((item) => (
                        <Box
                            pb={5}
                            bg="#ffdde1"
                            mb={1}
                            mt={1}
                            w="100%"
                            p={4}
                            borderRadius={10}
                        >
                            {/* Title */}
                            <Text fontSize="xl">
                                What is default template in java spring?
                            </Text>
                            {/* Options Group */}
                            <Stack spacing={2} direction={"column"}>
                                <Checkbox
                                    colorScheme="purple"
                                    // iconColor="black"
                                    spacing={"1rem"}
                                    borderColor="white"
                                >
                                    HTML
                                </Checkbox>
                                <Checkbox
                                    colorScheme="purple"
                                    // iconColor="black"
                                    spacing={"1rem"}
                                    borderColor="white"
                                >
                                    Checkbox
                                </Checkbox>
                                <Checkbox
                                    colorScheme="purple"
                                    // iconColor="black"
                                    spacing={"1rem"}
                                    borderColor="white"
                                >
                                    Checkbox
                                </Checkbox>
                                <Checkbox
                                    colorScheme="purple"
                                    // iconColor="black"
                                    spacing={"1rem"}
                                    borderColor="white"
                                >
                                    Checkbox
                                </Checkbox>
                            </Stack>
                        </Box>
                    ))}
                    <Box alignSelf="flex-end" mt={2}>
                        <Button colorScheme="blue" size="md">
                            Submit
                        </Button>
                    </Box>
                </Flex>
                {/* End of questions */}
            </Center>
        </Box>
    );
};

export default Quiz;
